'use strict';

// MODULES //

var data = require( './data.js' );
var Buffer = require( '@stdlib/buffer/ctor' );


// MAIN //

/**
* Returns an image of an abandoned dust bowl home.
*
* @returns {Buffer} image
*
* @example
* var img = image();
* // returns <Buffer>
*/
function image() {
	return new Buffer( data, 'base64' );
} // end FUNCTION image()


// EXPORTS //

module.exports = image;
